#include <stdio.h>

void spread(char board[][251], int numRows, int numColumns, int x, int y)
{
    board[x][y] = 'Y';
    if(x > 0 && board[x-1][y] == 'O')
        spread(board, numRows, numColumns, x-1, y);
    if(y > 0 && board[x][y-1] == 'O')
        spread(board, numRows, numColumns, x, y-1);
    if(x < numRows-1 && board[x+1][y] == 'O')
        spread(board, numRows, numColumns, x+1, y);
    if(y < numColumns-1 && board[x][y+1] == 'O')
        spread(board, numRows, numColumns, x, y+1);
}


void solve(char board[][251], int numRows, int numColumns) {
    for(int i=0; i<numColumns; ++i){
        if(board[0][i] == 'O')
            spread(board, numRows, numColumns, 0, i);
        if(board[numRows-1][i] == 'O')
            spread(board, numRows, numColumns, numRows-1, i);
    }
    
    for(int i=0; i<numRows; ++i){
        if(board[i][0] == 'O')
            spread(board, numRows, numColumns, i, 0);
        if(board[i][numColumns-1] == 'O')
            spread(board, numRows, numColumns, i, numColumns-1);
    }
    
    for(int i=0; i<numRows; ++i)
        for(int j=0; j<numColumns; ++j){
            if(board[i][j] == 'O')
                board[i][j] = 'X';
            if(board[i][j] == 'Y')
                board[i][j] = 'O';
        }
}

